import Cookie from 'universal-cookie/es6';
import { Redirect } from "react-router";
import AdminLayout from "./Components/AdminLayout/AdminLayout"

const MTTraderApp = () =>{
    var [isLogin,setLogin] = setState(false);

    var cookies = new Cookie();
        if(cookies.get('logedInUser') !== undefined){
            this.setLogin(true);
        }
    return(
        <>
            <AdminLayout >
            {isLogin?'':<Redirect to='/login'/>}
                <div className="jumbotron floid-container row mt-2" style={{height: '450px'}}>
                    <h3 >Data States Soon Available</h3>
                </div>
            </AdminLayout>
        </>
    )
}

export default MTTraderApp;
